import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';


var lat,long,i=0,lat1,long1;


const get= async()=>{
        console.log('inside get '+i);
            i++;
        const response= await fetch('https://trackmebaby.herokuapp.com/db');
        const data= await response.json();
        lat1= await data.results[0].latitude;
        long1= await data.results[0].longitude;
        lat=lat1;
        long=long1;
        console.log("now lat ="+parseFloat(lat)+" long="+parseFloat(long)); 
}

async function put(){
  await get();
  console.log('inside put '+i);
            i++;
  window.lat=lat;
  window.long=long;
  ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
  }

put();
